import {Component} from "react";

export class Contact extends Component {
    render() {
        return (
            <div className="flex">
                <div className="h-auto pt-5 pl-10 mx-auto"></div>
                <h1 className="text-3xl text-green-400 underline decoration-2">
                    This is Contact Component!</h1>
            </div>
        );
    }
}
